import React, { useState } from "react";
import "./index.css";

function App() {
  const [time, setTime] = useState("TIME");

  function getTime() {
    const currentTime = new Date().toLocaleTimeString();
    setTime(currentTime);
  }

  return (
    <div className="container">
      <h1>{time}</h1>
      <button onClick={getTime}>Get Time</button>
    </div>
  );
}

export default App;
